import React from 'react'
import "./Resturant.css";
function Resturant() {
    return (
        <> 
            <div id="patrick">
            <h1 >
               <span className="Pratik">
            Hello world
            
            </span>
            </h1>
            </div>
        </>
    )
}

export default Resturant
